// src/components/Dashboard.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './Dashboard.css';
import api from '../api/axios'; // Import Axios instance

function Dashboard() {
  const [doctorList, setDoctorList] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchDoctorList = async () => {
      try {
        const response = await api.get('/doctors'); // Adjust endpoint as needed
        setDoctorList(response.data);
      } catch (err) {
        setError('Failed to load data');
        console.error('Error fetching doctor list:', err);
      }
    };

    fetchDoctorList();
  }, []);

  return (
    <div className="dashboard">
      <h1>Welcome to the Dashboard</h1>
      {error && <p className="error">{error}</p>}
      
      <ul>
        <li><Link to="/doctorlist">Doctor List</Link></li>
        <li><Link to="#">User List</Link></li>
        <li><Link to="#">Patient List</Link></li>
        <li><Link to="#">Admin List</Link></li>
        <li><Link to="#">Appointment List</Link></li>
        <li><Link to="#">Availability Dates</Link></li>
        <li><Link to="#">Feedback List</Link></li>
        <li><Link to="#" className="logout">Logout</Link></li>
      </ul>

      <div className="doctor-list">
        <h2>Doctor List</h2>
        {doctorList.length > 0 ? (
          <ul>
            {doctorList.map((doctor) => (
              <li key={doctor.id}>{doctor.name}</li>
            ))}
          </ul>
        ) : (
          <p>No doctors available</p>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
